'use strict';(function(){const indexCfg={cache:true};indexCfg.doc={id:'id',field:['title','content'],store:['title','href'],};const index=FlexSearch.create('balance',indexCfg);window.bookSearchIndex=index;index.add({'id':0,'href':'/docs/get_started/','title':"Get Started",'content':""});index.add({'id':1,'href':'/docs/configuration/','title':"Configuration",'content':""});index.add({'id':2,'href':'/docs/functions/','title':"Functions",'content':""});index.add({'id':3,'href':'/docs/commands/','title':"Commands",'content':""});index.add({'id':4,'href':'/docs/commands/migrate/','title':"Migrate",'content':""});index.add({'id':5,'href':'/docs/commands/version/','title':"Version",'content':"Krab version The version command prints the version of Krab.\nUsage krab version Example $ krab version krab 0.2.0 "});index.add({'id':6,'href':'/docs/configuration/environment_variables/','title':"Environment Variables",'content':"Environment variables  KRAB_DIR - directory to load configuration from (default: current working directory) DATABASE_URL - PostgreSQL connection url  "});index.add({'id':7,'href':'/docs/configuration/migration/','title':"Migration",'content':"Migration Migration resource is a single migrate operation.\nmigration \u0026#34;\u0026lt;reference\u0026gt;\u0026#34; { version = \u0026#34;\u0026lt;version\u0026gt;\u0026#34; up { sql = \u0026#34;...\u0026#34; } down { sql = \u0026#34;...\u0026#34; } }  \u0026lt;reference\u0026gt; - is a migration reference name to use when connecting to other resources \u0026lt;version\u0026gt; (optional) - name that will be used to identify migration in the database, if not specified is equal to the reference up / down - migration direction, contains SQL code to be executed  Example migration \u0026#34;create_tenants\u0026#34; { version = \u0026#34;20060102150405\u0026#34; up { sql = \u0026#34;CREATE TABLE tenants(name VARCHAR PRIMARY KEY)\u0026#34; } down { sql = \u0026#34;DROP TABLE tenants\u0026#34; } } "});index.add({'id':8,'href':'/docs/configuration/migration_set/','title':"Migration Set",'content':"Migration Set Migration Set is a collection of migrations.\nmigration_set \u0026#34;\u0026lt;reference\u0026gt;\u0026#34; { migrations = [ ... ] }  \u0026lt;reference\u0026gt; - migration set reference name migrations - list of migrations references  Example migration_set \u0026#34;private\u0026#34; { migrations = [ migration.create_tenants ] } migration \u0026#34;create_tenants\u0026#34; { version = \u0026#34;20200628\u0026#34; up { sql = \u0026#34;CREATE TABLE tenants(name varchar PRIMARY KEY)\u0026#34; } down { sql = \u0026#34;DROP TABLE tenants\u0026#34; } } "});index.add({'id':9,'href':'/docs/functions/filesystem/','title':"Filesystem",'content':"Filesystem file_read file_read reads a file at the given path and returns its content as a string.\nsql = file_read(\u0026#34;path\u0026#34;) "});index.add({'id':10,'href':'/docs/get_started/overview/','title':"Overview",'content':"TODO\n"});index.add({'id':11,'href':'/docs/','title':"Docs",'content':""});index.add({'id':12,'href':'/docs/commands/migrate/down/','title':"down",'content':"Migrate down The migrate down command rollbacks selected migration. After successful operation its ID is removed from migration table. At the beginning of an operation advisory lock is acquired to prevent other operations to run simultaneously.\nUsage krab migrate down [set] [version] Options  set - name of the set to migrate. version - migration ID to rollback.  Example For default migration set and migration version 20060102150405 you would use:\nkrab migrate down default 20060102150405 "});index.add({'id':13,'href':'/docs/commands/migrate/up/','title':"up",'content':"Migrate up The migrate up command migrates all pending migration for a given migration set. After successful migration its ID is put into database migration table (by default schema_migrations). When migration table does not exist it will be created. At the beginning of an operation advisory lock is acquired to prevent other migrations to run simultaneously.\nUsage krab migrate up [set] Options  set - name of the set to migrate.  Example For default migration set you would use:\nkrab migrate up default "});})();